import React, { useState } from 'react';

export default function Form() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    contact: '',
    description: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const submitData = async (event) => {
    event.preventDefault();
    const { name, contact, email, description } = formData;

    if (name && contact && email && description) {
      try {
        const res = await fetch(
          "https://practice-c217b-default-rtdb.firebaseio.com/contacts.json", 
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              name,
              email,
              contact,
              description,
            }),
          }
        );

        if (res.ok) {
          setFormData({
            name: "",
            email: "",
            contact: "",
            description: ""
          });
          alert("Data Stored");
        } else {
          alert("Failed to store data");
        }
      } catch (error) {
        console.error('Error:', error);
        alert("Error submitting form, please try again.");
      }
    } else {
      alert("Please fill in all the data");
    }
  };

  return (
    <div className="mt-6 h-auto bg-gradient-to-r from-gray-700 via-gray-800 to-gray-900 mx-auto flex items-center justify-center min-h-screen">
  <div className="bg-gradient-to-r from-gray-600 via-gray-700 to-gray-800 p-8 rounded-lg w-full max-w-md md:max-w-lg lg:max-w-xl xl:max-w-2xl shadow-lg">
    <h2 className="text-2xl font-bold mb-6 text-center text-white">
      Enroll Now<br />and Get Skilled
    </h2>
    <p className="text-md font-bold text-center mb-2 text-gray-200">
      Please fill the below form and we will get back to you!
    </p>
    <form method='POST' onSubmit={submitData} className="space-y-4">
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <label htmlFor="name" className="block text-gray-200 text-sm font-medium">
            Name
          </label>
          <input
            type="text"
            name="name"
            id="name"
            placeholder='Enter your name'
            value={formData.name}
            onChange={handleChange}
            className="mt-1 p-2 block w-full bg-gray-700 border border-gray-600 rounded-md focus:ring-gray-500 focus:border-gray-500 sm:text-sm text-gray-100"
            required
          />
        </div>
        <div>
          <label htmlFor="email" className="block text-gray-200 text-sm font-medium">
            Email
          </label>
          <input
            type="email"
            name="email"
            id="email"
            placeholder='Enter email address'
            value={formData.email}
            onChange={handleChange}
            className="mt-1 p-2 block w-full bg-gray-700 border border-gray-600 rounded-md focus:ring-gray-500 focus:border-gray-500 sm:text-sm text-gray-100"
            required
          />
        </div>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <label htmlFor="contact" className="block text-gray-200 text-sm font-medium">
            Contact
          </label>
          <input
            type="text"
            name="contact"
            id="contact"
            placeholder='Enter your contact details'
            value={formData.contact}
            onChange={handleChange}
            className="mt-1 p-2 block w-full bg-gray-700 border border-gray-600 rounded-md focus:ring-gray-500 focus:border-gray-500 sm:text-sm text-gray-100"
            required
          />
        </div>
        <div>
          <label htmlFor="coupon" className="block text-gray-200 text-sm font-medium">
            Coupon Code
          </label>
          <input
            type="text"
            name="coupon"
            id="coupon"
            placeholder='Optional'
            value={formData.coupon}
            onChange={handleChange}
            className="mt-1 p-2 block w-full bg-gray-700 border border-gray-600 rounded-md focus:ring-gray-500 focus:border-gray-500 sm:text-sm text-gray-100"
          />
        </div>
      </div>
      <div>
        <label htmlFor="description" className="block text-gray-200 text-sm font-medium">
          Message
        </label>
        <textarea
          name="description"
          id="description"
          placeholder='Write something that you are interested in learning'
          value={formData.description}
          onChange={handleChange}
          className="mt-1 p-3 block w-full bg-gray-700 border border-gray-600 rounded-md focus:ring-gray-500 focus:border-gray-500 sm:text-sm text-gray-100"
          required
        />
      </div>
      <div>
        <button
          type="submit"
          className="w-full bg-gray-600 text-white py-2 px-4 rounded-md hover:bg-gray-700 focus:ring-gray-500 focus:ring-offset-2 focus:outline-none focus:ring-2 focus:ring-opacity-75"
        >
          Submit
        </button>
      </div>
    </form>
  </div>
</div>




  );
}
